    const [myPosts, setMyPosts] = useState({})
    const postData = [
        {
            user: {
                imageLink: 'https://media.licdn.com/dms/image/D5603AQGjblpQF8i3dQ/profile-displayphoto-shrink_100_100/0/1708017518813?e=1726704000&v=beta&t=mlN2k-Zx92mucn1Er74Y1yaQj95DKql8R_1LoyllITk',
                name: 'Sagar Rasuri',
                followers: 30,
