                        bio: 'Technical lead - Software Development (Node.js | Express.js | AWS)',
                        profileLink: 'https://media.licdn.com/dms/image/D4D0BAQHMKzGgo2i7kw/company-logo_100_100/0/1706721913192/ai_avenue_logo?e=1729728000&v=beta&t=hI2nN2ePCgRs8Co66p4_6RQAg7yT_dXKn1RyK9rNKQ4',
                    },
                    comment: {
                        content: 'What a fascinating development! OpenAI realizes it\'s important to keep the technology affordable while expanding its range of features. Not having live access is not a deal breaker considering everything.',
                        likes: 2,
                        replies: 1,
                    }
                }
            ]
        }
    ];
    useState(() => {
        const fetchPosts = async() => {
            await axiosInstance('/posts')
        } 
    })
    return (
        <div className="feed-posts">
            {postData.map((post, index) => (
                <div className="feedPost" key={index}>
                    <Post post={post} />
                </div>
            ))}
        </div>
    );
}

export default Feed;
